    "Rugged Optical Atmospheric Humidity Sensor Project",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T03:46:04.610152",nt"name": "rugged-optical-atmospheric-humidity-sensor-project",nt"isopen":
    true,nt"url": null,nt"notes": "Trace species measurement on unmanned atmospheric
    research craft suitable for interplanetary travel is a demanding application for
    optical sensing techniques.  Yet optical techniques offer many advantages including
    high-precision, fast response, and strong species selectivity.  Balloonsonde, kite,
    unmanned aerial vehicle (UAV), or glider deployment demands that optical sensors
    meet stringent size, weight and power requirements.  Vista Photonics proposes to
    develop rugged, compact, battery-powered optical sensor technology capable of selectively
    determining humidity to 10 parts-per-billion (-100 &lt;SUP&gt;o&lt;/SUP&gt;C frost
    point).  The enabling technology for meeting stringent NASA mission requirements
    is a new rugged, compact, and lightweight optical path length enhancement cell that
    recovers the theoretical sensitivity of established high-performance optical absorption
    detection techniques.  The proposed spectrometer will be capable of detecting multiple
    species while incurring little additional weight or power penalties.",nt"license_title":
